import React, {useEffect} from 'react'
import { useGetCartQuery, selectAllCart } from '../api/cartSlice'
import { useCopyCouponMutation, selectCouponById, selectAllCoupons } from '../api/couponsSlice'
import CartItem from './CartItem'
import { useSelector } from "react-redux"
import { useAddOrderMutation } from '../api/ordersSlice'
import jCaptcha from 'js-captcha';

export const ShoppingCart = ({setCartTotal, setCart, name, email, phone, adress, deliveryType, totalCost, order}) => {
  const [addOrder, { isLoading:isLoadingAddOrder, isSuccess:isSuccessAddOrder }] = useAddOrderMutation()
  const coupons = useSelector(selectAllCoupons)
  let couponsSelected = [];
  for (let i = 0; i < coupons.length; i++) {
    if(coupons[i].copied === true){
      couponsSelected.push(coupons[i])
    }
  }
  const couponsSelectedDiv = couponsSelected.map(coupon => {
    return <div key={coupon.id}>{coupon.name} uah</div>
  })
  console.log(couponsSelected);
  const cart = useSelector(selectAllCart)
  const contentCart = cart.map(cartItemId=> <CartItem key={cartItemId.id} cartItemId={cartItemId}/>)
  function total(){
    let temp = cart.map(function(item){
      return item.price*item.quantity
    })
    let sum = temp.reduce(function(prev, next){
      return prev+next
    }, 0)
    return sum
  }
  let totalCart = total(); 
  localStorage.setItem('cart', JSON.stringify(cart));

  useEffect(() => {
    setCartTotal(totalCart);
    const cartToSave = JSON.stringify(cart)
    setCart(cartToSave)
  }, [totalCart, cart])

  const onSubmitClicked = async () => {
    if(!isLoadingAddOrder) {
      try {
        // await addCustomer({ name, email, phone, adress}).unwrap()
        await addOrder({ name, email, phone, adress, deliveryType, totalCost, order}).unwrap()

      } catch (err) {
          console.error('Failed to summbit the purchase', err)
      }
    } else {
      console.log('not loading add order');
    }
  }
// optionally, set maximum number of captcha validation on event:
const maxNumberOfTries = 5;

// captcha initial setup
var myCaptcha = new jCaptcha({

    el: ".jCaptcha",
    canvas: {
        class: "jCaptchaCanvas",
        style: {
          // properties for captcha stylings:
          width: 100,
          height: 15,
          textBaseline: "top",
          font: "15px Arial",
          textAlign: "left",
          fillStyle: "#ddd"
        }
    },
    // set callback function
    callback: function(response, $captchaInputElement, numberOfTries) {

        if (maxNumberOfTries === numberOfTries) {

          // maximum attempts reached, so do something
          // e.g. disable the form:
          document.querySelector("form").removeEventListener("submit", formSubmit);
          $captchaInputElement.classList.add("disabled");
          $captchaInputElement.placeholder = "Maximum attempts reached!";
          $captchaInputElement.setAttribute("disabled", "true");
          document.querySelector("button").setAttribute("disabled", "true");

          return;
        }

        if (response == 'success') {

          $captchaInputElement[0].classList.remove('error');
          $captchaInputElement[0].classList.add('success');
          $captchaInputElement[0].placeholder = 'Submit successful!';

          // continue with form submit

        }

        if (response == 'error') {

          $captchaInputElement[0].classList.remove('success');
          $captchaInputElement[0].classList.add('error');
          $captchaInputElement[0].placeholder = 'Please try again!';
        }
    }

});

// validate captcha on form submit event
function formSubmit(e) {
    e.preventDefault();

    // myCaptcha validate
    myCaptcha.validate();
};

document.querySelector("form").addEventListener("submit", formSubmit);

  return (
    <div className='shoppingCart'>
      <div className='cartTitle'>
          <div>Medicine</div>
          <div>Price</div>
          <div>Quantity</div>
          <div>Shop</div>
          <div>Total</div>
          <div></div>
      </div>
      <div>{contentCart}</div>
      <div className='cartBottom'>
        <div className='couponsCopied'>{couponsSelected.length > 0 ? couponsSelectedDiv : 'Selected Coupons: none'}</div>
        <form className="form" action="">
          <input className="jCaptcha" type="text" placeholder="Type in result please"/>
          <button type="submit">Submit</button>
        </form>
        <div className='cartTotal'><div>{'Total:'}</div><div>{totalCart.toFixed(2)}</div></div>
        <button className="submitButton" onClick={onSubmitClicked}>Submit</button>
      </div>

    </div>

  )
}
